import {
  Container,
  Navbar,
  Nav
} from 'react-bootstrap';

function HeaderPokemon() {
  return (
    <div className='HeaderPokemon'>
      <header className="Pokemon-header">
        <h1> teste</h1>
      </header>
    </div >
  );
}

const CampoPesquisa = props => {
  return (
    <div className='CampoPesquisa'> </div>
  )
}

const BodyPokemon = props => {
  return (
    <div className='BodyPokemon'> </div>
  )
}

function App() {
  return (
    <div className='App'>
      <HeaderPokemon />
      <CampoPesquisa />
      <BodyPokemon />
    </div>
  )
}

export default App
